import {
    BrowserRouter
    ,Link
    ,Routes
    ,Route
    // ,createRoutesFromElements
    // ,createBrowserRouter
    } from 'react-router-dom'




const SignUpFlow = ({props}) => {
    const [role, setRole] = useState('Diif');
    return (
        <>
        <h1> { role } </h1>
        <button onClick={() => setRole(200)}> setRole </button>
        <Routes>
        <UserRole.Provider value={{role, setRole}}>
            <Route path= '/blabla'
                action={({ props }) => {}}
                element = {
                    <ChooseRolePage />
                }

                />;
            <Route path={Constantans.SIGN_UP + '/' + Constantans.REG_FORM}
                action={({ props }) => {}}
                element = {<QuestionnairePage />}
                />;
        </UserRole.Provider>
        </Routes>
        </>
  );
                    };
export default SignUpFlow;
